    const [state, setstate] = useState('START\nТЕSТ')

    return (
        <div>
            <div className='btnContainer' >
                <NavLink to="/Assesment" className="testButton" onClick={() => {
                    props.setStartTimer()
                    props.setShow()
                }} >{state}</NavLink>
            </div>
        </div>
    )
}
